import React, { useState } from 'react';
import OtpInput from 'react-otp-input';

export default function OTPFunction() {
 const[enteredOTP , setEnteredOTP] = useState()
    return (
      <div>
        <OtpInput
        value={enteredOTP}
          onChange={otp => console.log(otp)}
          numInputs={5}
          separator={<span>-</span>}
        />
      </div>
    )
  
}
